Example_1:
input: ['.', '.', '.', 'e', 'e', 'e', 'e', 'e', 'e', '.', '.', '.', '.', '.']
output: ['.', '.', '.', 'h', 'h', 'h', 'h', 'h', 'h', '.', '.', '.', '.', '.']

Example_2:
input: ['.', '.', 'e', 'e', 'e', 'e', 'e', 'e', '.', '.', '.', 'e', '.', '.']
output: ['.', '.', 'h', 'h', 'h', 'h', 'h', 'h', '.', '.', '.', 'b', '.', '.']

Example_3:
input: ['.', '.', '.', 'e', 'e', 'e', '.', '.', 'e', 'e', 'e', 'e', 'e', 'e']
output: ['.', '.', '.', 'b', 'b', 'b', '.', '.', 'h', 'h', 'h', 'h', 'h', 'h']

Test case:
input: ['.', 'e', 'e', '.', '.', 'e', '.', '.', 'e', '.', '.', '.', '.', '.']

###########################################################
Sample Outputs:
output: ['.', 'b', 'b', '.', '.', 'b', '.', '.', 'h', '.', '.', '.', '.', '.']
*/

public class Solution {
    public String[] convert(String[] s) {
        if (s == null || s.length < 4) return s;
        int len = s.length, hLen = 0, bLen = 0;
        for (int i = 0; i < len; ++i) {
            if (s[i].equals(".")) continue;
            else if (s[i].equals("e")) {
                if (hLen!= 0 && bLen!= 0) break;
                if (hLen == 0) hLen = i;
                else bLen = i;
            }
        }
        if (hLen == 0 || bLen == 0) return s;
        char[] res = new char[len];
        Arrays.fill(res, '.');
        // fill head part
        for (int i = 0; i < hLen; ++i) {
            if (!s[i].equals(".")) res[i] = 'h';
        }
        // fill body part
        for (int i = hLen + 1; i <= bLen; ++i) {
            if (!s[i].equals(".")) res[i] = 'b';
        }
        // fill tail part
        for (int i = bLen + 1; i < len; ++i) {
            if (!s[i].equals(".") &&!s[i - 1].equals("e") &&!s[i - 2].equals("e")) {
                res[i] = 'h';
            }
        }
        for (int i = 0; i < len; ++i) {
            s[i] = "" + res[i];
        }
        return s;
    }
}
